CREATE EXTENSION IF NOT EXISTS postgis;

START TRANSACTION;

DO $EF$
BEGIN
    IF NOT EXISTS(SELECT 1 FROM pg_namespace WHERE nspname = 'geo_data') THEN
        CREATE SCHEMA geo_data;
    END IF;
END $EF$;

CREATE EXTENSION IF NOT EXISTS postgis;

CREATE TABLE geo_data.cities (
    id bigint GENERATED BY DEFAULT AS IDENTITY,
    external_id uuid NOT NULL,
    name text NOT NULL,
    center geometry NOT NULL,
    CONSTRAINT "PK_cities" PRIMARY KEY (id)
);

INSERT INTO geo_data.cities (name, center, external_id) VALUES ('Saint-Petersburg', ST_SetSRID(ST_MakePoint(30.308611, 59.937500), 4326), '00000000-0000-0000-0000-000000000001');

COMMIT;

START TRANSACTION;

CREATE TABLE geo_data.schools (
    id bigint GENERATED BY DEFAULT AS IDENTITY,
    name text NOT NULL,
    description text NULL,
    address text NOT NULL,
    location geometry NOT NULL,
    address_comment text NULL,
    mail_index text NULL,
    district text NULL,
    city_id bigint NOT NULL,
    okrug text NULL,
    region text NULL,
    country text NULL,
    working_hours text NULL,
    timezone text NULL,
    rating double precision NULL,
    two_gis_url text NULL,
    CONSTRAINT "PK_schools" PRIMARY KEY (id),
    CONSTRAINT "FK_schools_cities_city_id" FOREIGN KEY (city_id) REFERENCES geo_data.cities (id) ON DELETE CASCADE
);

CREATE INDEX "IX_schools_city_id" ON geo_data.schools (city_id);


COMMIT;

START TRANSACTION;

