DROP TABLE geo_data.schools;

CREATE TABLE geo_data.organizations (
    id bigint GENERATED BY DEFAULT AS IDENTITY,
    type integer NOT NULL,
    name text NOT NULL,
    description text NULL,
    address text NOT NULL,
    location geometry NOT NULL,
    address_comment text NULL,
    mail_index text NULL,
    district text NULL,
    city_id bigint NOT NULL,
    okrug text NULL,
    region text NULL,
    country text NULL,
    working_hours text NULL,
    timezone text NULL,
    rating double precision NULL,
    two_gis_url text NULL,
    CONSTRAINT "PK_organizations" PRIMARY KEY (id),
    CONSTRAINT "FK_organizations_cities_city_id" FOREIGN KEY (city_id) REFERENCES geo_data.cities (id) ON DELETE CASCADE
);

