CREATE INDEX "IX_organizations_city_id" ON geo_data.organizations (city_id);

SELECT setval(
    pg_get_serial_sequence('geo_data.organizations', 'id'),
    GREATEST(
        (SELECT MAX(id) FROM geo_data.organizations) + 1,
        nextval(pg_get_serial_sequence('geo_data.organizations', 'id'))),
    false);

COMMIT;

